text = """"""

counter = 3
result = ""

while counter < len(text) - 3 :
    pos1 = ord(text[counter - 3]) >= ord('A') and ord(text[counter - 3]) <= ord('Z')
    pos2 = ord(text[counter - 2]) >= ord('A') and ord(text[counter - 2]) <= ord('Z')
    pos3 = ord(text[counter - 1]) >= ord('A') and ord(text[counter - 1]) <= ord('Z')
    pos0 = ord(text[counter + 0]) >= ord('a') and ord(text[counter + 0]) <= ord('z')
    pos4 = ord(text[counter + 1]) >= ord('A') and ord(text[counter + 1]) <= ord('Z')
    pos5 = ord(text[counter + 2]) >= ord('A') and ord(text[counter + 2]) <= ord('Z')
    pos6 = ord(text[counter + 3]) >= ord('A') and ord(text[counter + 3]) <= ord('Z')

    if pos1 and pos2 and pos3 and pos4 and pos5 and pos6 and pos0:

        p1 = ord(text[counter - 4]) >= ord('a') and ord(text[counter - 4]) <= ord('z')
        p2 = ord(text[counter + 4]) >= ord('a') and ord(text[counter + 4]) <= ord('z')

        if p1 and p2:
            result += text[counter]

    counter = counter + 1

print(result) # linkedlist